import React from "react";
import "../navbar/navbar.css";
import logo1 from './logo1.png';

function Navbar() {
    return (
      <>
        <div className="container">
          <header className="container-fluid d-flex flex-wrap justify-content-center py-3 mb-4 fixed-top bg-light">
            <a href="/" className="d-flex align-items-center mb-3 mb-md-0 me-md-auto text-decoration-none">
              
              <span className="fs-4">
                <img id="logo1" src={ logo1 }></img>

              </span>
            </a>

            <div className="topLeftBorders">
            <a href="#">HOME</a>
            <a href="#">ARTICLES</a>
            <a href="#">PORTFOLIO</a>
            <a href="#">ABOUT</a>
            <a href="#">CONTACT</a>
            </div>
          </header>
        </div>
      </>
   );
  }
export default Navbar;
